import './App.css';
import Card from "./Card"
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  return (
    <div classNameName="App">
      <section className="pricing py-5">
      <div className="container">
        <div className="row">
          <Card tier="FREE"/>
          <Card tier="PLUS"/>
          <Card tier="PRO"/>
        </div>
      </div>
      </section>
    </div>
  );
}

export default App;
